import java.io.*
import org.apache.nifi.processor.io.StreamCallback

def flowFile = session.get()
if (flowFile == null) {
    return
}

try{
    flowFile = session.write(flowFile,
            { inputStream, outputStream ->
                repair(inputStream, outputStream)
            } as StreamCallback)
    session.transfer(flowFile, ExecuteScript.REL_SUCCESS)
}catch(Exception e){
    session.transfer(flowFile, ExecuteScript.REL_FAILURE)
}



def repair(def inputStream, def outputStream) {
    BufferedReader br = new BufferedReader(new InputStreamReader(inputStream, "UTF8"))

    String line = null
    BufferedWriter fw = new BufferedWriter(new OutputStreamWriter(outputStream, "UTF8"))
    while ((line = br.readLine()) != null) {
        fw.write(line)
        fw.write("\n")
    }
    fw.flush()
}
